function Continue() {
  return (
    <>
      <div class="flex gap-2 mt-2 justify-center items-center h-[100vh]">
        <button class="font-Poppins bg-[#2D429B] h-[34px] rounded-lg font-medium">
          <span class="text-white p-36 text-[23px] ">Continue assessment</span>
        </button>

        <div>
          <img src="images/png/Continuous-Assessments.png" alt="" />
        </div>
      </div>
    </>
  );
}

export default Continue;
